import React, { Component } from 'react'
import ButtonList from "../components/ButtonList"

class DiscountFeature extends Component {
  render() {
    return (
      <div className="container">
        <div className="question-container">
          <span>Are you a member or customer of any of the organizations below?</span>
          <p class="subtext">Select as many as apply to maximize your discounts</p>
        </div>
        <ButtonList list={["AAA", "AARP", "U.S. Military or Veterans Association", "American Express"]}/>
      </div>
    )
  }
}

export default DiscountFeature;
